According to band member Xavier de Rosnay, &quot;DVNO&quot; stands for &quot;Divino.&quot; de Rosnay states, &quot;In every suburb of the world, in every city, there's always a nightclub called El Divino... Clubs where you have to wear a white shirt to get in.&quot;

 The vocalist featured in the song is Mehdi Pinson from the band <a href="http://www.last.fm/music/Scenario+Rock" class="bbcode_artist">Scenario Rock</a>.

